const Home = () => {

    const handleClick = (e) =>{
        console.log('hello troopers', e);
    }
    const handleClickAgain = (name) => {
        console.log('hello ' + name, e.target);
    }
    return ( 
        <div className="home">
            <h2>homepage</h2>
            <button onClick={handleClick}>Click me</button>
            <button onClick = {(e) => handleClickAgain('Mario', e)}> Click me again</button>
        </div>
     );
}

export default Home;
